import React from "react";
import Detail from "../../data/detail.json";
const DelailList = () => {
  console.log(Detail.photos);
  Detail.photos.map((colll, index) =>
    console.log(colll)(
      <div>
        <img src={colll} alt={colll.index}></img>
      </div>
    )
  );
  return (
    <div key={Detail.name}>
      <div>
        <h1>{Detail.name}</h1>
        <button>Reserve or Book Now</button>
      </div>
      <p>{Detail.address}</p>
      <h4>{Detail.distance}</h4>
      <h4>{Detail.price}</h4>

      <div>
        {Detail.photos.map((coll, index) => (
          <div>
            <img src={coll.photos} alt={Detail.photos.index}></img>
          </div>
        ))}
      </div>
      <h1>{Detail.title}</h1>
      <p>{Detail.description}</p>
    </div>
  );
};

export default DelailList;
